import React, { useState } from "react";
import {
  Stack, Button, Box, Typography, Select, MenuItem, InputLabel, FormControl, Snackbar, IconButton, TextField, Tooltip, Paper
} from "@mui/material";
import DeleteIcon from '@mui/icons-material/Delete';
import AddIcon from "@mui/icons-material/Add";
import InlineEdit from "./InlineEdit";

const priorityColor = {
  'Haute': '#b00020',
  'Moyenne': '#bf8600',
  'Basse': '#296d25'
};
const typeOptions = ["Organisation", "Personnalité"];
const statusOptions = [
  "À contacter", "En contact", "En attente", "Terminé"
];

export default function ContactBoard({ contacts, onAdd, onUpdate, onDelete }) {
  const [filterStatus, setFilterStatus] = useState("");
  const [filterType, setFilterType] = useState("");
  const [search, setSearch] = useState("");
  const [snackbar, setSnackbar] = useState({ open: false, msg: "" });

  // Ajout
  const addContact = () => {
    const name = prompt("Nom du contact ?");
    if (name) {
      onAdd({
        name,
        type: 'Organisation',
        priority: 'Basse',
        status: 'À contacter',
        notes: ''
      });
      setSnackbar({ open: true, msg: "Contact ajouté !" });
    }
  };

  // Modif
  const updateContact = (id, field, value) => {
    const c = contacts.find(c => c.id === id);
    if (!c) return;
    onUpdate(id, { ...c, [field]: value });
    setSnackbar({ open: true, msg: "Contact mis à jour !" });
  };

  // Suppression
  const removeContact = (id) => {
    if (window.confirm("Supprimer ce contact ?")) {
      onDelete(id);
      setSnackbar({ open: true, msg: "Contact supprimé." });
    }
  };

  // Filtrage/recherche
  let filtered = contacts;
  if (filterStatus) filtered = filtered.filter(c => c.status === filterStatus);
  if (filterType) filtered = filtered.filter(c => c.type === filterType);
  if (search.trim()) filtered = filtered.filter(c => c.name.toLowerCase().includes(search.trim().toLowerCase()));

  return (
    <Box sx={{ maxWidth: 800, mx: "auto", pb: 3 }}>
      <Stack direction="row" alignItems="center" spacing={2} sx={{ mb: 2 }}>
        <Typography variant="h4" fontWeight={700} sx={{ flexGrow: 1 }}>Contacts</Typography>
        <Button
          variant="contained"
          color="primary"
          onClick={addContact}
          startIcon={<AddIcon />}
          sx={{ fontWeight: 600, minWidth: 120, height: 44, fontSize: 16, boxShadow: "none" }}
        >
          + Nouveau
        </Button>
      </Stack>

      {/* Barre de filtres */}
      <Stack direction="row" spacing={2} alignItems="center" sx={{ mb: 2, flexWrap: "wrap" }}>
        <TextField
          placeholder="Recherche nom…"
          value={search}
          onChange={e => setSearch(e.target.value)}
          size="small"
          sx={{ minWidth: 180 }}
        />
        <FormControl size="small" sx={{ minWidth: 130 }}>
          <InputLabel>Statut</InputLabel>
          <Select value={filterStatus} label="Statut" onChange={e => setFilterStatus(e.target.value)}>
            <MenuItem value="">Tous</MenuItem>
            {statusOptions.map(status =>
              <MenuItem key={status} value={status}>{status}</MenuItem>
            )}
          </Select>
        </FormControl>
        <FormControl size="small" sx={{ minWidth: 130 }}>
          <InputLabel>Type</InputLabel>
          <Select value={filterType} label="Type" onChange={e => setFilterType(e.target.value)}>
            <MenuItem value="">Tous</MenuItem>
            {typeOptions.map(type =>
              <MenuItem key={type} value={type}>{type}</MenuItem>
            )}
          </Select>
        </FormControl>
        <Button variant="outlined" onClick={() => { setFilterStatus(""); setFilterType(""); setSearch(""); }}>
          Réinitialiser
        </Button>
      </Stack>

      {/* Liste des contacts */}
      <Stack spacing={3} sx={{ mt: 2 }}>
        {filtered.map(c => (
          <Paper
            key={c.id}
            sx={{
              px: 3, py: 2.5, background: "rgba(255,255,255,0.90)",
              borderLeft: `6px solid ${priorityColor[c.priority]}`,
              borderRadius: 3, boxShadow: "0 2px 12px rgba(60,60,120,0.09)"
            }}
          >
            <Stack direction="row" alignItems="flex-start" justifyContent="space-between">
              <Box sx={{ flex: 1 }}>
                <Typography variant="h6" fontWeight={700} sx={{ mb: 0.5 }}>
                  <InlineEdit
                    value={c.name}
                    onSave={val => updateContact(c.id, "name", val)}
                    style={{ fontWeight: 700, fontSize: "1.13rem" }}
                  />
                  <Typography component="span" sx={{ fontWeight: 500, color: "#444", fontSize: 15, ml: 1 }}>
                    ({c.type})
                  </Typography>
                </Typography>
                <Stack direction="row" spacing={2} alignItems="center" sx={{ mb: 1 }}>
                  <FormControl size="small" sx={{ minWidth: 110 }}>
                    <InputLabel>Statut</InputLabel>
                    <Select
                      value={c.status}
                      label="Statut"
                      onChange={e => updateContact(c.id, "status", e.target.value)}
                    >
                      {statusOptions.map(status =>
                        <MenuItem key={status} value={status}>{status}</MenuItem>
                      )}
                    </Select>
                  </FormControl>
                  <FormControl size="small" sx={{ minWidth: 110 }}>
                    <InputLabel>Priorité</InputLabel>
                    <Select
                      value={c.priority}
                      label="Priorité"
                      onChange={e => updateContact(c.id, "priority", e.target.value)}
                      sx={{
                        color: priorityColor[c.priority], fontWeight: "bold"
                      }}
                    >
                      <MenuItem value="Haute" sx={{ color: priorityColor["Haute"] }}>Haute</MenuItem>
                      <MenuItem value="Moyenne" sx={{ color: priorityColor["Moyenne"] }}>Moyenne</MenuItem>
                      <MenuItem value="Basse" sx={{ color: priorityColor["Basse"] }}>Basse</MenuItem>
                    </Select>
                  </FormControl>
                </Stack>
                <Typography
                  variant="body2"
                  color="text.secondary"
                  sx={{ fontWeight: 500, mb: 0.2 }}
                >Notes :</Typography>
                <InlineEdit
                  value={c.notes}
                  onSave={val => updateContact(c.id, "notes", val)}
                  type="textarea"
                  style={{
                    width: "100%", minHeight: 32, background: "#f7fafd",
                    borderRadius: 4, color: "#111", fontSize: "1rem"
                  }}
                />
              </Box>
              <Box>
                <Tooltip title="Supprimer">
                  <IconButton
                    aria-label="Supprimer"
                    color="error"
                    onClick={() => removeContact(c.id)}
                    sx={{ ml: 2, width: 44, height: 44 }}
                  >
                    <DeleteIcon fontSize="medium" />
                  </IconButton>
                </Tooltip>
              </Box>
            </Stack>
          </Paper>
        ))}
        {!filtered.length && <Typography sx={{ color: "#888", mt: 3 }}>Aucun contact trouvé…</Typography>}
      </Stack>
      <Snackbar
        open={snackbar.open}
        autoHideDuration={1800}
        onClose={() => setSnackbar({ open: false, msg: "" })}
        message={snackbar.msg}
        anchorOrigin={{ vertical: "bottom", horizontal: "center" }}
      />
    </Box>
  );
}
